import React from "react";
import App1 from "./App1";
import App2 from "./App2";
import App3 from "./App3";
function App() {
  return (
    <div>
      <div>
        <App1></App1>
      </div>
      <div>
        <App2></App2>
      </div>
      <div>
        <App3></App3>
      </div>
    </div>
  );
}
export default App;
